import React, { useState } from 'react';
import RangeSlider from 'react-bootstrap-range-slider';
import Form from 'react-bootstrap/Form'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

const MyComponent = () => {

    const [ value1, setValue1 ] = React.useState(25);
    const [ value2, setValue2 ] = React.useState(25);
    const [ value3, setValue3 ] = React.useState(25);
    const result=(setValue1,setValue2,setValue3)=>{
      return(setValue1*setValue1)
    }

  return (
    <Form>
     <Form.Group as={Row}>
       <Col xs="4">
         <Form.Control value={value1} size='sm'/>
       </Col>
       <Col xs="8">
         <RangeSlider
           value={value1}
           onChange={e => setValue1(e.target.value)}
           size='sm'
         />
       </Col>
     </Form.Group>
     <Form.Group as={Row}>
       <Col xs="4">
         <Form.Control value={value2}/>
       </Col>
       <Col xs="8">
         <RangeSlider
           value={value2}
           onChange={e => setValue2(e.target.value)}
         />
       </Col>
     </Form.Group>
     <Form.Group as={Row}>
       <Col xs="4">
         <Form.Control value={value3} size='lg'/>
       </Col>
       <Col xs="8">
         <RangeSlider
           value={value3}
           onChange={e => setValue3(e.target.value)}
           size='lg'
         />
       </Col>
     </Form.Group>
     <div>{result()}</div>
     </Form>
  );

};

export default MyComponent
